export const User = () => {
    const [openUserModal, setOpenUserModal] = useState(false);

    return(
        <button className="User" onClick={() => {
            setOpenUserModal(true);
        }}>
            <FontAwesomeIcon icon={faUser} style={{color: "#ffffff",}} className="user-icon"/>
        </button>
    )
}
